@mixin hover($_property, $_toValue) {
  transition: #{$_property} 0.3s;
  &:hover {
    #{$_property}: $_toValue;
  }
}

@mixin for-tablet() {
  @media (min-width: 744px) {
    @content;
  }
}

@mixin for-desktop() {
  @media (min-width: 1260px) {
    @content;
  }
}

@mixin smooth($property) {
  transition: $property 0.5s ease-in-out;
}

